import "../styles/src/Footer.scss";

function Footer() {
  return (
    <>
      <footer id="footBox">
        <h2>
          <span className="blind">저작권 정보</span>
        </h2>
        <address>&copy; All rights reserved ...</address>
      </footer>
    </>
  )
}


export default Footer;
